import '../css/registration.css';

function Registration() {
    return (
        <form className='form-registration'>
            <h3>username</h3>
            <input type='login'/>
            <h3>email</h3>
            <input type='email'/>
            <h3>password</h3>
            <input type='password'/>
            <h3>repeat password</h3>
            <input type='password'/>
            <button>Submit</button>
        </form>
    );
}

export default Registration;
